import React from 'react';
import styled from "styled-components";

const Foot= styled.div`
width:100%;
height: 150px;
background-color: white;
margin-left: 300px;

`;

const StyledLink =styled.link`
    color: aqua;
`;
const Footer = () => {
    return (
 <Foot>Album example is © Bootstrap, but please download and customize it for yourself!

 <br/>New to Bootstrap? Visit the homepage or read our getting started guide.</Foot>
    );
};

export default Footer;
